import React, { useState } from 'react';
import { Container, Title, Input, Wrapper, Button } from "./LoginPage.style";

const LoginPage = () => {

    const [values, setValues] = useState({
        email: "",
        pass: "",
    });

    function handleEmailChange(val) {
        setValues({
            ...values,
            email: val
        })
    }

    function handlePasswordChange(val) {
        setValues({
            ...values,
            pass: val
        })
    }

    return (
        <Container>
            <Wrapper>
                <Title>Log in</Title>
                <Input placeholder="Email address"  type="email" value={values.email} onChnage={(e) => handleEmailChange(e.target.value)} />

                <Input placeholder="Password"  type="password" value={values.pass} onChnage={(e) => handlePasswordChange(e.target.value)} />

                <Button onClick={() => console.log("logging in")}>Log me in!</Button>
            </Wrapper>
        </Container>
    );
};

export default LoginPage;
